【シニアおやつ 3つの成分で栄養サポート カフェオレの詳細】<br>
●コーヒーの上品な香りを楽しめる、なめらかでミルク感たっぷりなカフェオレに仕立てました。<br>
●豊富なたんぱく質とカルシウムに加え、11種類のビタミンをミックスした粉末飲料で、手軽に美味しく、日々の生活をサポートします。<br><br>

【ご注意】<br>
○食事介助の必要な方は飲み込むまで様子を見守ってください。<br>
○開封後はチャックをしっかりと閉め、湿気などが入らないように保管し、なるべくお早めにお召し上がりください。<br>
○ご使用の際は、乾いたスプーンを使用してください。<br><br>

【原材料】<br>
クリーミングパウダー(デキストリン、植物油脂、乳糖、脱脂粉乳)、乳たんぱく、砂糖、デキストリン、インスタントコーヒー、植物油脂、食塩、カゼインNa、pH調整剤、リン酸Ca、乳化剤、V.C、V.E、ナイアシン、パントテン酸Ca、V.B1、カロテン、V.B6、V.B2、V.A、葉酸、V.D、V.B12<br><br>

【栄養成分】1杯25g当たり<br>
エネルギー：107kcaL、たんぱく質：5.0g、脂質：2.7g、炭水化物：15.6g、ナトリウム：29mg、(食塩相当量：0.1g)、カルシウム：210mg、ビタミンA：47μg、ビタミンD：4.5μg、ビタミンE：0.6mg、ビタミンB1：0.09mg、ビタミンB2：0.15mg、ナイアシン：2.3mg、ビタミンB6：0.08mg、ビタミンB12：0.4μg、葉酸：20μg、パントテン酸：0.63mg、ビタミンC：7mg、カフェイン：48mg<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
175g<br><br>

