【エンジョイクリミール コーンスープ味の詳細】<br>
●モラック乳酸菌100億個配合：森永乳業が保有する数千株の菌から加齢とともに低下する「免疫力」に着目して選ばれた乳酸菌です。<br>
●栄養機能食品（亜鉛・銅）：栄養機能食品とは、1日当たりの摂取目安量に含まれる栄養成分量が厚生労働大臣が定める規格基準に適合すれば、所定の栄養機能を表示することができる食品です。<br><br>

【ご注意】<br>
○牛乳・大豆由来の成分が含まれています。アレルギーを示す方は使用しないでください。<br>
○容器に漏れ・膨脹等が見られるもの、開封時に内容物の色・臭い・味に異常があるものはお飲みにならないでください。<br>
○原材料の一部が沈殿・浮遊することがありますが、品質には問題ありません。開封前によく振ってからお飲みください。<br>
○静脈内ヘは絶対に注入しないでください。<br>
○容器が落下、衝撃等により破損しますと、無菌性が損なわれます。取扱いには十分注意してください。<br>
○容器に漏れ・膨脹等がみられるもの及び容器の破損しているものはお飲みにならないでください。<br>
○室温で保存できますが、おいしさを保つために冷所での保管をおすすめします。<br>
○直射日光があたる場所や、高温な場所、凍結するような場所で保管しますと、風味劣化等の性状変化が認められる場合があります。<br>
○本品は、多量摂取により疾病が治癒したり、より健康が増進するものではありません。1日の摂取目安量を守ってください。<br>
○本品は、特定保健用食品と異なり、消費者庁長官による個別審査を受けたものではありません。<br>
○亜鉛の摂りすぎは、銅の吸収を阻害するおそれがありますので、過剰摂取にならないよう注意してください。<br>
○1日の摂取目安量を守ってください。<br>
○本品は、多量摂取により疾病が治癒したり、より健康が増進するものではありません。1日の摂取目安量を守ってください。<br>
○本品は、特定保健用食品と異なり、消費者庁長官による個別審査を受けたものではありません。<br>
○多量に摂取すると軟便(下痢)になることがあります。<br>
○1日の摂取目安量を守ってください。<br>
○乳幼児・小児は本品の摂取を避けてください。<br><br>

【原材料】<br>
デキストリン、乳たんぱく質、植物油、グラニュー糖、難消化性デキストリン、乳酸菌(殺菌)、乾燥酵母、カゼインナトリウム、香料、pH調整剤、乳化剤、塩化カリウム、色素*、グルコン酸亜鉛、グルコン酸銅、(原材料の一部に乳成分、大豆を含む)<br><br>

【栄養成分】125mlあたり<br>
